    massimoTurni: { valore: 23, giorno: "29" },
    minimoTurni: { valore: 6, giorno: "05" }
  },
  "Agosto 2024": {
    giorni: 12,
    totaleTurni: 72,
    mediaGiornaliera: 6.00,
    massimoTurni: { valore: 13, giorno: "01" },
    minimoTurni: { valore: 2, giorno: "06" }
  }
};

export const yearlyStats2024 = {
  totalTurni: 425,
  totalDays: 35,
  avgGiornaliera: 12.14
};

export const yearlyStats2023 = {
  totalTurni: 3000,
  totalDays: 250,
  avgGiornaliera: 12.00
};
